import React from 'react'

import './picture-card.css'

const cont = {
    backgroundColor: "#eee",
    overflow: "hidden",
    position: "relative"
};

const PictureCard = ({ photo, margin }) => {
    return (
        <div style={{ margin }}>
            <img class="image" src={photo.src} alt="" width={photo.width} height={photo.height} />
            {/* <div class="bottom-right overlay-text">{photo.caption}</div> */}
        </div>
    );
};

export default PictureCard
